package main

import (
	"context"
	"fmt"
	"math/big"

	"github.com/sjatsh/tongo"
	"github.com/sjatsh/tongo/boc"
	"github.com/sjatsh/tongo/tlb"
	"github.com/sjatsh/tongo/tvm"
)

func main() {
	// Execute nft collection contract to get nft item address by index
	// https://github.com/ton-blockchain/TIPs/issues/62
	// get_nft_address_by_index(int index) returns slice address

	codeCell, _ := boc.DeserializeBocBase64("")
	dataCell, _ := boc.DeserializeBocBase64("")
	config, _ := boc.DeserializeBocBase64("")
	index := tlb.Int257(*big.NewInt(100))
	account := tongo.MustParseAddress("0:4ccba08d80193c3eb4f92cd8cf10bc425ff2d705a552aad6f3453a141e51b7b7")

	val := tlb.VmStackValue{
		SumType:  "VmStkInt",
		VmStkInt: index,
	}

	emulator, err := tvm.NewEmulator(codeCell[0], dataCell[0], config[0])
	if err != nil {
		panic(err)
	}

	err = tvm.SetVerbosityLevel(1)
	if err != nil {
		panic(err)
	}

	code, res, err := emulator.RunSmcMethod(context.Background(), account.ID, "get_nft_address_by_index", tlb.VmStack{val})
	if err != nil {
		panic(err)
	}

	if code != 0 && code != 1 { // 1 - alternative success code
		panic("TVM execution failed")
	}

	if len(res) != 1 || res[0].SumType != "VmStkSlice" {
		panic("invalid stack data")
	}

	c := res[0].VmStkSlice.Cell()
	var a tlb.MsgAddress
	err = tlb.Unmarshal(c, &a)
	if err != nil {
		panic(err)
	}
	accId, err := tongo.AccountIDFromTlb(a)
	if err != nil {
		panic(err)
	}

	fmt.Printf("Item address: %v", accId.ToRaw())

}
